import React from "react";
import { Carousel } from "react-carousel-minimal";
import LevelUp from "../assets/LevelUp.png";
import CodingQuiz from "../assets/CodingQuiz.png";
import Klaw from "../assets/Klaw.png";
import Weather from "../assets/Weather.png";
import MyTeam from "../assets/MyTeam.png";
import workDay from "../assets/workDay";
import JATE from "../assets/JATE";

function Gallery(props) {
  const data = [
    {
      image: LevelUp,
      caption: "Level Up Fitness",
    },
    {
      image: CodingQuiz,
      caption: "Coding Quiz",
    },
    {
      image: Klaw,
      caption: "Klaw Movies",
    },
    {
      image: Weather,
      caption: "Weather Dashboard",
    },
    {
      image: MyTeam,
      caption: "Team Profile Generator",
    },
    {
      image: workDay,
      caption: "Work Day Scheduler",
    },
    {
      image: JATE,
      caption: "Just Another Text Editor",
    },
    {
      image:
        "https://www.oyorooms.com/travel-guide/wp-content/uploads/2019/02/summer-7.jpg",
      caption: "Darjeeling",
    },
  ];

  const captionStyle = {
    fontSize: "2em",
    fontWeight: "bold",
  };
  const slideNumberStyle = {
    fontSize: "20px",
    fontWeight: "bold",
  };
  return (
    <React.Fragment>
      <div
        className="Gallery"
        ref={(el) => (props.myRef.current.projects = el)}
      >
        <div style={{ textAlign: "center" }}>
          <h2 className="gallery-title">Projects</h2>
          <p></p>
          <div
            style={{
              padding: "0 20px",
            }}
          >
            <Carousel
              data={data}
              time={2000}
              width="850px"
              height="500px"
              captionStyle={captionStyle}
              radius="10px"
              slideNumber={true}
              slideNumberStyle={slideNumberStyle}
              captionPosition="bottom"
              automatic={true}
              dots={true}
              pauseIconColor="white"
              pauseIconSize="40px"
              slideBackgroundColor="white"
              slideImageFit="contain"
              thumbnails={true}
              thumbnailWidth="100px"
              style={{
                textAlign: "center",
                maxWidth: "850px",
                maxHeight: "500px",
                margin: "40px auto",
              }}
            />
          </div>
        </div>
      </div>
      <div>
        <span>
          <a href="https://github.com/Laurencvengros/Project_2">
            Level Up Fitness
          </a>
          <a href="https://kelsieszost.github.io/pop-up-quiz/">Coding Quiz</a>
          <a href="https://laurencvengros.github.io/KLAW_Movies/">
            KLAW Movies
          </a>
          <a href="https://kelsieszost.github.io/weather-dashboard/">
            Weather Dashboard
          </a>
          <a href="https://github.com/kelsieszost/teamprofilegenerator">
            Team Profile Generator
          </a>
          <a href="https://kelsieszost.github.io/workday-schedule/">
            Workday Scheduler
          </a>
          <a href="https://kelsieszost.github.io/workday-schedule/">
            Workday Scheduler
          </a>
        </span>
      </div>
    </React.Fragment>
  );
}

export default Gallery;
